import React, { useState } from 'react';
import { SafeAreaView } from 'react-native';
import styleSheet from './Pages/PageStyle';
import MaterialTabPage from './Pages/MaterialTabPage';
import { ScrollView } from 'react-native-gesture-handler';
import FCHomePage from './FunctionalComponents/FCHomePage';
import { NavigationContainer } from '@react-navigation/native';
import { createMaterialBottomTabNavigator } from '@react-navigation/material-bottom-tabs';
import FCWines from './FunctionalComponents/FCWines';

function App() {
  const Tab = createMaterialBottomTabNavigator();

  return (
    <NavigationContainer>
      <Tab.Navigator
        initialRouteName="Home"
        activeColor="#f0edf6"
        inactiveColor="#3e2465"
        barStyle={{ backgroundColor: '#691A1A' }}
      >
        <Tab.Screen name="Home" component={FCHomePage}
          options={{
            tabBarLabel: 'Updates',
            tabBarIcon: ({ color }) => (
              <MaterialCommunityIcons name="bell" color={color} size={26} />
            ),
          }}
        />
        <Tab.Screen name="wines" component={FCWines} />
      </Tab.Navigator>
    </NavigationContainer>
  );
}


export default App;
